syntax = "proto3";

package sdc.biceps;

option java_multiple_files = true;
option java_package = "org.somda.sdc.proto.model.biceps";
option java_outer_classname = "TimeFrameProto";

import "google/protobuf/wrappers.proto";

message TimeFrameMsg {
  google.protobuf.UInt64Value a_start = 1;
  google.protobuf.UInt64Value a_end = 2;
}
